import React, { Component } from 'react';
import { Text, View } from 'react-native';
import { F1APIService } from '../../services/F1APIService';

class Season extends Component {

    state = {
        races: [],
    }

    componentDidMount() {
        console.log(this.props.route.params.year)
        new F1APIService().getSeasonInfo()
        .then(seasonInfo => this.setState({ races: seasonInfo }) )
        .catch(error => console.error(error) )
    }

    renderRaces() {
        const { races, url, raceName, date, time } = this.state;

        return races.map( ({round})  => (
        <Text key={round}>Corrida: {round} | Nome: raceName | Data: {date}</Text>
        ))
    }

    render() {
        return(
            <View>
                { this.renderRaces() }
            </View>
        );
    }
}

export default Season;
